import axios from "axios";

export async function getList(){
    try {
        const res = await axios({
            url: "https://6006de003698a80017de21f1.mockapi.io/api/todo-list",
            method: "GET"
        });
        return res.data;
    } catch (error) {
        console.log(error)
    }
}
